iller.invoice_admin_fees iaf WHERE iaf.account_id = inv.account_id AND iaf.cycle_log_id = inv.cycle_log_id ) as has_adminfees, ( SELECT COUNT(isb.*) > 0 FROM biller.invoice_service_bundles isb INNER JOIN biller.invoice_service_charges USING (invoice_service_bundle_id) WHERE cycle_log_id = inv.cycle_log_id AND account_id = inv.account_id AND sab_charge_type IS NULL and (total_price > 0)
) as has_non_sab_charges, ( SELECT COUNT(isb.*) > 0 FROM biller.invoice_service_bundles isb INNER JOIN biller.invoice_service_charges USING (invoice_service_bundle_id) WHERE cycle_log_id = inv.cycle_log_id AND account_id = inv.account_id AND sab_charge_type IS NOT NULL ) as has_sab_charges, exists( SELECT 1 FROM biller.cycle_usage_charges cuc LEFT JOIN biller.cycle_usage_charge_details USING (cycle_usage_charge_id) WHERE cycle_log_id = inv.cycle_log_id AND account_id = inv.account_id AND usage_charge_type_cd <> 'cdr' limit 1 ) AS has_usage_data
FROM biller.invoice_summaries inv JOIN biller.cycle_log cl USING (cycle_log_id) JOIN biller.cycles c USING (cycle_cd) JOIN biller.bill_frequencies bf USING (bill_frequency_cd) WHERE inv.account_id = (select account_id from params) AND inv.cycle_log_id = (select cycle_log_id from params)

