WITH params AS ( SELECT ? AS cycle_log_id, ? AS account_id ), latest_contract_terms AS ( SELECT DISTINCT ON (1) o.service_id, term_cd, term, contract_start_date :: DATE FROM biller.cycle_service_charges csc JOIN om.order_charges USING (order_charge_id) JOIN om.orders o USING (order_id) JOIN common.terms USING (term_cd) WHERE cycle_log_id = (SELECT cycle_log_id FROM params) ORDER BY 1 DESC, 2, 3 ), charges AS ( SELECT isc.invoice_service_charge_id, isc.invoice_service_bundle_id, isc.service_id, isc.order_charge_id, replace(replace(isc.charge_description, ' - Interstate', ''), ' - Intrastate', '') as charge_description, isc.from_date, isc.to_date, isc.quantity, isc.sab_rate, isc.total_price as amt, isc.sab_piu, isc.sab_bill_percent, isc.sab_charge_type, om.format_product_circuit_id( isb.circuit_id, bc.product_cd ) AS circuit_id, charge_type_cd, --case when order_type_cd='DS' then parent_order_id else order_id end as order_id, -- order_id, bill_date, product, (case when order_type_cd='DS' then parent_order_id else order_id end)::text as order_number, --SPLIT_PART(change_order_id,'-', 1) AS order_number, p.product_cd, nc, nci
FROM biller.invoice_service_bundles isb JOIN biller.invoice_service_charges isc USING (invoice_service_bundle_id) JOIN biller.cycle_log USING (cycle_log_id) JOIN om.order_charges USING (order_charge_id) JOIN om.orders USING (order_id) JOIN om.billing_components bc USING (billing_component_id) JOIN om.billing_component_types bct ON (bc.product_cd = bct.product_cd AND bc.billing_component_type_cd = bct.billing_component_type_cd) JOIN common.products p ON (bc.product_cd = p.product_cd) WHERE cycle_log_id = (SELECT cycle_log_id FROM params) AND isb.account_id = (SELECT account_id FROM params) --Filter out $0 NRC Charges AND (charge_type_cd = 'MR' OR total_price != 0) --Filter out mrc nrc does not apply when not zero AND (total_price != 0 OR (charge_type_cd = 'MR' AND bct.mrc_na IS FALSE)) AND sab_charge_type IS NOT NULL ), a_locs as ( SELECT order_id, common.format_us_address(address1, address2, city, state_cd, zip, zip4) as address FROM om.order_addresses where order_id IN (select order_id from charges) and 'ALoc' = ANY(tags) and disabled > now() ), z_locs as ( SELECT order_id, common.format_us_address(address1, address2, city, state_cd, zip, zip4) as address FROM om.order_addresses where order_id IN (select order_id from charges) and 'ZLoc' = ANY(tags) and disabled > now() ), intra_inter as ( SELECT coalesce(c1.order_number, c2.order_number) as order_number, coalesce(c1.charge_description, c2.charge_description) as charge_description, c1.invoice_service_charge_id as intra_service_charge_id, c2.invoice_service_charge_id as inter_service_charge_id, coalesce(c1.invoice_service_bundle_id, c2.invoice_service_bundle_id) as invoice_service_bundle_id, coalesce(c1.circuit_id, c2.circuit_id) as circuit_id, coalesce(c1.product, c2.product) as product, coalesce(c1.to_date, c2.to_date) as to_date, coalesce(c1.from_date, c2.from_date) as from_date, coalesce(c1.sab_piu, c2.sab_piu) as sab_piu, coalesce(c1.bill_date, c2.bill_date) as bill_date, coalesce(c1.order_id, c2.order_id) as order_id, coalesce(c1.service_id, c2.service_id) as service_id, coalesce(c1.quantity, c2.quantity) as quantity, c1.amt as intrastate_amt, c2.amt as interstate_amt, c1.sab_rate as intrastate_rate, c2.sab_rate as interstate_rate, coalesce(c1.sab_bill_percent, c2.sab_bill_percent) as sab_bill_percent, c1.product_cd, c1.nc, c1.nci FROM charges c1 FULL OUTER JOIN charges c2 ON ( c1.charge_description = c2.charge_description and c1.to_date = c2.to_date and c1.from_date = c2.from_date and (c1.sab_charge_type = 'intrastate' or c1.sab_charge_type IS NULL) and (c2.sab_charge_type = 'interstate' or c2.sab_charge_type IS NULL) and c1.invoice_service_bundle_id = c2.invoice_service_bundle_id and c1.product = c2.product and c1.sab_piu= c2.sab_piu and c1.bill_date = c2.bill_date and c1.order_id = c2.order_id and c1.sab_bill_percent = c2.sab_bill_percent AND c1.quantity = c2.quantity ) WHERE ( c1.sab_charge_type = 'intrastate' or c1.sab_charge_type IS NULL ) and ( c2.sab_charge_type = 'interstate' or c2.sab_charge_type IS NULL ) ), sab_carriers as ( SELECT order_id a_end_carrier_cd, z_end_carrier_cd, (select carrier_nm from om.sab_carriers where carrier_cd = a_end_carrier_cd) as a_end_carrier_nm, (select carrier_nm from om.sab_carriers where carrier_cd = z_end_carrier_cd) as z_end_carrier_nm FROM om.product_sa UNION ALL SELECT order_id a_end_carrier_cd, z_end_carrier_cd, (select carrier_nm from om.sab_carriers where carrier_cd = a_end_carrier_cd) as a_end_carrier_nm, (select carrier_nm from om.sab_carriers where carrier_cd = z_end_carrier_cd) as z_end_carrier_nm FROM om.product_sw --Need to update and union for new Switched access product when tables are created ) SELECT DISTINCT ON (intra_service_charge_id) *, (select address from a_locs where order_id = c.order_id )as a_location, (select address from z_locs where order_id = c.order_id )as z_location, ( SELECT term FROM latest_contract_terms WHERE service_id = c.service_id ) AS term, ( SELECT contract_start_date FROM latest_contract_terms WHERE service_id = c.service_id ) AS contract_start_date, ( SELECT z_end_carrier_nm from sab_carriers where order_id = c.order_id limit 1
) as a_end_carrier, ( SELECT a_end_carrier_nm from sab_carriers where order_id = c.order_id limit 1
) as z_end_carrier, ( CASE WHEN product_cd = 'SA' THEN (SELECT orig_cust_serving_clli from om.product_sa where order_id = c.order_id limit 1) ELSE (SELECT orig_cust_serving_clli from om.product_sw where order_id = c.order_id limit 1) END ) as a_end_clli, ( CASE WHEN product_cd = 'SA' THEN (SELECT term_cust_serving_clli from om.product_sa where order_id = c.order_id limit 1) ELSE (SELECT term_cust_serving_clli from om.product_sw where order_id = c.order_id limit 1) END
) as z_end_clli, nc, nci FROM intra_inter c order by intra_service_charge_id, inter_service_charge_id

